import React from 'react';


class Pokemon extends React.Component {


    state = {
        "pokemons-faction1": [
            {
                Name: "Pikachu",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 1
            },
            {
                Name: "Bulbasaur",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 2
            },
            {
                Name: "Snorlax",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 3
            }
        ],
        "pokemons-faction2": [
            {
                Name: "Charizard",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 4
            },
            {
                Name: "Mewtwo",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 5
            },
            {
                Name: "Ditto",
                Icons: "",
                AttackPower: "",
                DefensePower: "",
                TotalHealth: "",
                id: 6
            }
        ]
    }
    render() {
        return (
            <div>
                {console.log(this.state['pokemons-faction1'][0].Name)}
                <h4>Faction 1</h4>

                <div id="faction-1">
                    <ul className="list-group">
                    {this.state['pokemons-faction1'].map(pokemon => (
                        <li className="list-group-item d-flex justify-content-between align-items-center" key = {pokemon.id}>
                            {pokemon.Name}
                            <img src="src/imgs/Pikachu.jpg"  alt="Pokemon Icon"/>
                            <span className="badge badge-primary badge-pill">Att. Power: {pokemon.AttackPower} </span>
                            <span className="badge badge-primary badge-pill">Att. Power: {pokemon.AttackPower} </span>

                        </li>
                        ))}
                    </ul>
                </div>



            </div>
        );
    }
};


export default Pokemon;
